import React, { useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  SafeAreaView,
  Dimensions,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { LineChart, PieChart } from 'react-native-chart-kit';
import { useSelector } from 'react-redux';
import { useNavigation } from '@react-navigation/native';
import { RootState } from '../../store/store';

const { width } = Dimensions.get('window');

const ReportsScreen = () => {
  const navigation = useNavigation();
  const [selectedPeriod, setSelectedPeriod] = useState('month');
  const userIssues = useSelector((state: RootState) => state.issues.userIssues);

  // Mock user issues data
  const mockUserIssues = [
    {
      id: '1',
      title: 'Pothole near my house',
      category: 'Potholes',
      status: 'completed',
      submittedAt: '2024-01-05T10:00:00Z',
      completedAt: '2024-01-15T14:30:00Z',
      upvotes: 12,
    },
    {
      id: '2',
      title: 'Garbage collection issue',
      category: 'Garbage',
      status: 'in_progress',
      submittedAt: '2024-01-10T09:15:00Z',
      upvotes: 8,
    },
    {
      id: '3',
      title: 'Street light not working',
      category: 'Street Lights',
      status: 'acknowledged',
      submittedAt: '2024-01-12T16:45:00Z',
      upvotes: 5,
    },
    {
      id: '4',
      title: 'Water supply disruption',
      category: 'Water Supply',
      status: 'submitted',
      submittedAt: '2024-01-14T11:20:00Z',
      upvotes: 3,
    },
  ];

  // Chart data
  const lineChartData = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        data: [2, 3, 1, 4, 2, 1],
        color: (opacity = 1) => `rgba(46, 125, 50, ${opacity})`,
        strokeWidth: 2,
      },
    ],
  };

  const pieChartData = [
    { name: 'Completed', population: 1, color: '#4CAF50', legendFontColor: '#333' },
    { name: 'In Progress', population: 1, color: '#FF5722', legendFontColor: '#333' },
    { name: 'Acknowledged', population: 1, color: '#2196F3', legendFontColor: '#333' },
    { name: 'Submitted', population: 1, color: '#FF9800', legendFontColor: '#333' },
  ];

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'submitted': return '#FF9800';
      case 'acknowledged': return '#2196F3';
      case 'assigned': return '#9C27B0';
      case 'in_progress': return '#FF5722';
      case 'completed': return '#4CAF50';
      default: return '#757575';
    }
  };

  const getStatusIcon = (status: string) => {
    switch (status) {
      case 'submitted': return 'time-outline';
      case 'acknowledged': return 'checkmark-circle-outline';
      case 'assigned': return 'person-outline';
      case 'in_progress': return 'construct-outline';
      case 'completed': return 'checkmark-done-outline';
      default: return 'help-outline';
    }
  };

  const formatDate = (dateString: string) => {
    return new Date(dateString).toLocaleDateString('en-IN', {
      day: 'numeric',
      month: 'short',
      year: 'numeric',
    });
  };

  const handleTrackIssue = (issueId: string) => {
    navigation.navigate('TrackIssue' as never, { issueId } as never);
  };

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.headerTitle}>My Reports</Text>
        <Text style={styles.headerSubtitle}>Track your submitted issues</Text>
      </View>

      <ScrollView style={styles.content} showsVerticalScrollIndicator={false}>
        {/* Statistics Cards */}
        <View style={styles.statsContainer}>
          <View style={styles.statCard}>
            <Ionicons name="document-text-outline" size={24} color="#2E7D32" />
            <Text style={styles.statNumber}>{mockUserIssues.length}</Text>
            <Text style={styles.statLabel}>Total Issues</Text>
          </View>
          <View style={styles.statCard}>
            <Ionicons name="checkmark-done-outline" size={24} color="#4CAF50" />
            <Text style={styles.statNumber}>
              {mockUserIssues.filter(issue => issue.status === 'completed').length}
            </Text>
            <Text style={styles.statLabel}>Resolved</Text>
          </View>
          <View style={styles.statCard}>
            <Ionicons name="construct-outline" size={24} color="#FF5722" />
            <Text style={styles.statNumber}>
              {mockUserIssues.filter(issue => issue.status === 'in_progress').length}
            </Text>
            <Text style={styles.statLabel}>In Progress</Text>
          </View>
        </View>

        {/* Period Selector */}
        <View style={styles.periodSelector}>
          {['week', 'month', 'year'].map((period) => (
            <TouchableOpacity
              key={period}
              style={[
                styles.periodButton,
                selectedPeriod === period && styles.periodButtonActive,
              ]}
              onPress={() => setSelectedPeriod(period)}
            >
              <Text
                style={[
                  styles.periodButtonText,
                  selectedPeriod === period && styles.periodButtonTextActive,
                ]}
              >
                {period.charAt(0).toUpperCase() + period.slice(1)}
              </Text>
            </TouchableOpacity>
          ))}
        </View>

        {/* Issues Filed vs Resolved Chart */}
        <View style={styles.chartSection}>
          <Text style={styles.chartTitle}>Issues Filed Over Time</Text>
          <LineChart
            data={lineChartData}
            width={width - 40}
            height={200}
            chartConfig={{
              backgroundColor: '#ffffff',
              backgroundGradientFrom: '#ffffff',
              backgroundGradientTo: '#ffffff',
              decimalPlaces: 0,
              color: (opacity = 1) => `rgba(46, 125, 50, ${opacity})`,
              labelColor: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
              style: {
                borderRadius: 16,
              },
              propsForDots: {
                r: '4',
                strokeWidth: '2',
                stroke: '#2E7D32',
              },
            }}
            bezier
            style={styles.chart}
          />
        </View>

        {/* Status Distribution Chart */}
        <View style={styles.chartSection}>
          <Text style={styles.chartTitle}>Issue Status Distribution</Text>
          <PieChart
            data={pieChartData}
            width={width - 40}
            height={200}
            chartConfig={{
              color: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
            }}
            accessor="population"
            backgroundColor="transparent"
            paddingLeft="15"
            style={styles.chart}
          />
        </View>

        {/* Recent Issues */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Your Recent Issues</Text>
          {mockUserIssues.map((issue) => (
            <TouchableOpacity
              key={issue.id}
              style={styles.issueCard}
              onPress={() => handleTrackIssue(issue.id)}
            >
              <View style={styles.issueHeader}>
                <View style={styles.statusBadge}>
                  <Ionicons
                    name={getStatusIcon(issue.status) as any}
                    size={16}
                    color={getStatusColor(issue.status)}
                  />
                  <Text style={[styles.statusText, { color: getStatusColor(issue.status) }]}>
                    {issue.status.replace('_', ' ').toUpperCase()}
                  </Text>
                </View>
                <Text style={styles.issueDate}>{formatDate(issue.submittedAt)}</Text>
              </View>

              <Text style={styles.issueTitle}>{issue.title}</Text>

              <View style={styles.issueFooter}>
                <View style={styles.categoryTag}>
                  <Text style={styles.categoryText}>{issue.category}</Text>
                </View>
                <View style={styles.issueStats}>
                  <View style={styles.upvoteCount}>
                    <Ionicons name="arrow-up" size={14} color="#2E7D32" />
                    <Text style={styles.upvoteText}>{issue.upvotes}</Text>
                  </View>
                  <Ionicons name="chevron-forward" size={16} color="#666" />
                </View>
              </View>
            </TouchableOpacity>
          ))}
        </View>

        {/* Performance Insights */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Performance Insights</Text>
          <View style={styles.insightCard}>
            <View style={styles.insightIcon}>
              <Ionicons name="trending-up" size={24} color="#4CAF50" />
            </View>
            <View style={styles.insightContent}>
              <Text style={styles.insightTitle}>Great Response Rate!</Text>
              <Text style={styles.insightDescription}>
                75% of your issues received responses within 48 hours
              </Text>
            </View>
          </View>

          <View style={styles.insightCard}>
            <View style={styles.insightIcon}>
              <Ionicons name="time" size={24} color="#FF9800" />
            </View>
            <View style={styles.insightContent}>
              <Text style={styles.insightTitle}>Average Resolution Time</Text>
              <Text style={styles.insightDescription}>
                Your issues are resolved in an average of 8.5 days
              </Text>
            </View>
          </View>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

